import React from "react";
import { Link } from 'react-router-dom';

import styles from './header.module.css';

export const  Header = () => {
    return(
        <div className={styles.header}>
            <nav className={styles.menu}>
                <Link to="/" className="scan">물건인식</Link>
                <Link to="/" className="carbon">현재탄소량</Link>
                <Link to="/" className="guide">가이드</Link>
                <Link to="/" className="my">my</Link>
            </nav>
        </div>
    );
}
